import React from 'react';
import { FiChevronLeft } from 'react-icons/fi';
import { useRouteMatch, Link } from 'react-router-dom';

import logoImg from '../../assets/logo.svg';

import {
  Header,
  RepositoryInfo,
  RepositoryInfoHeader,
  RepositoryInfoList,
} from './styles';

interface IRouteParams { repository: string }

const Repository: React.FC = () => {
  const { params } = useRouteMatch<IRouteParams>();

  return (
    <>
      <Header>
        <img src={logoImg} alt="Github Explorer" />
        <Link to="/dashboard">
          <FiChevronLeft />
          Voltar
        </Link>
      </Header>

      <RepositoryInfo>
        <RepositoryInfoHeader>
          <img src="https://thispersondoesnotexist.com/image" alt="" />
          <div>
            <strong>oMatheusCaetano/adminPanel</strong>
            <p>Uma turminha da pesada</p>
          </div>
        </RepositoryInfoHeader>

        <RepositoryInfoList>
          <li>
            <strong>1808</strong>
            <span>Stars</span>
          </li>
          <li>
            <strong>48</strong>
            <span>Forks</span>
          </li>
          <li>
            <strong>27</strong>
            <span>Issues</span>
          </li>
        </RepositoryInfoList>
      </RepositoryInfo>
    </>
  );
};

export default Repository;
